import React from "react";
import styles from "./UserHomePage.module.css";

function UserHeader({name, lastname, balance}) {
    return(
        <div className={styles.user_homepage}>
            <div>
                <p>{name}</p>
                <FontAwesomeIcon icon="fa-solid fa-caret-down" />
            </div>
        </div>
    );
}

function UserHomePage({user}) {
    const { id, name, balance, lastname, email } = user; /* No olvidarse de eliminar el envio del password */
    return(
        <div className={styles.UserHomePage}>
            <p>{user.name}</p>
            <p>{user.balance}</p>
        </div>
    );
}

export default UserHomePage;
